import React from 'react';
import "../../css/Views/home.css"
import Button from '../Components/Button';
import Footer from '../Components/Footer';
import Header from '../Components/Header';

 class Home extends React.Component {
    render() {
      return (
        <div id="home">
            <Header/>
            <div id="transpBlock">
                <div id="transpBox">
                </div>
            </div>
            <div id="buttonBlock">
                <Button/>
            </div>
            <Footer/>
        </div>
      )
    }
  }

  export default Home
